import React from 'react';
import map from '../../assets/icons/map.svg'

const AboutUs = () => {
    return (
        <div сlassName='Hацелен на использование данных спектроскопии и визуализации для анализа и мониторинга биоразнообразия в Южной Африке.'>
            <img src={map} alt="" />
        </div>
    );
}

export default AboutUs;
